import React ,{ Component } from "react";
import {Route,Redirect,Link,Switch} from "react-router-dom";
import Patient from "./Patient";


class Homepage extends Component {
    constructor(props) {
        super(props);
        this.state = { 
          }  
        
    }
    render() { 
        return ( 
          <>
            <div class="pos-f-t">
              <div class="collapse" id="navbarToggleExternalContent">
                <div class="bg-dark p-4">
                  <h4 class="text-white">Collapsed content</h4>
                  <span class="text-muted">Toggleable via the navbar brand.</span>
                </div>
              </div>
              <nav class="navbar navbar-dark bg-dark">
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
                  <span class="navbar-toggler-icon"></span>
                </button>
              </nav>
            </div>
            <div className= "sidenav">
            <ul className="pagination" style={{display:"inline-block"}}>
            <li class="page-item " ><a class="page-link" style={{width:300}} href="this.props.history.push(/homepage/patient)">Patient</a><br/></li>
            <li class="page-item " > <a class="page-link" style={{width:300}} href="#section">Doctor</a><br/></li>
            <li class="page-item " ><a class="page-link" style={{width:300}} href="#section">Wards</a><br/></li>
            <li class="page-item " ><a class="page-link" style={{width:300}} href="#section">Wardboy</a><br/></li>
            </ul>
        </div>
            </>
         );
    }
}
 
export default Homepage;
